import React from 'react'
import '../index.css';

function Experience() {
  return (
    <div>
      <div className='Headings'>
        <h1 className='text-6xl font-bold text-center my-20'>Resume</h1>
        <h2 className='text-2xl text-center my-10'>Some Of My Experience!</h2>
      </div>
    </div>
  )
}

export default Experience
